export class itemDataTuple {
    constructor(axisPoints) {
        this._axisPoints = axisPoints;
    }
    getAxisPoint(axisName) {
        if (axisName) {
            return this._axisPoints.filter(axisPoint => {
                return axisPoint.getAxisName() == axisName;
            })[0];
        }
        else {
            return this._axisPoints[0];
        }
    }
}
